import Navbar from './components/Navbar';
import Carousel from './components/Carousel';
import PopularEvents from './components/PopularEvents';

function App() {
  return (
    <div className="bg-white min-h-screen font-sans">
      <Navbar />
      <Carousel />
      <PopularEvents />
    </div>
  );
}

export default App;
